  if (data1 !== undefined) {
    const cart = data1.dataUser.cart;
    const value_ID  = cart[0]._id_Product

    const arr = []
    for(let i=0;i<cart.length;i++)
    allData.filter((e) => {
      if (e._id === value_ID) {
        arr.push(e)
      }
    }
    );
    console.log(arr)
    

    return (
      <Box style={{ paddingTop: "10em" }}>
        {cart.map((e) => (
          <p>{e.quality}</p>
        ))}
      </Box>
    );
  }

  return (
    <div>
      <Emptycart />
    </div>
  );
};

export default Cart;
